    false,nt"url": null,nt"notes": "A "Bare Earth" Digital Elevation Model
    (DEM) data represents the bare ground surface without any objects like plants and
    buildings on it, was derived from the best available LiDAR "point cloud" data
    sources across the state by the UVM Spatial Analysis Lab and grouped into four seperate
    resolutions, i.e., ElevationDEM_DEM0p7m; ElevationDEM_DEM1m, ElevationDEM_DEM1p4m
    & ElevationDEM_DEM1p6m. For an overview of the "Vermont LiDAR Initiative" please
    see "http://vcgi.vermont.gov/lidar". For specific details on each project extent's
    "point cloud", e.g., flight dates, nominal pulse spacing and RMSEz etc., see the
    VCGI LiDAR data product page for links to vendor based metadata - http://vcgi.vermont.gov/warehouse/products/ALL-LDR_MIX_LIDAR_STATE_ALL.
    Ultimately, each LiDAR dataset extent will be integrated with the multi-resolution
    National Elevation Dataset (NED), at resolutions of approx. 1/27 arc-second (ranging
    from 0.7 to 1.6 meters) and "Elevation Quality Levels (QL)" of QL2 and QL3. See
    the "LiDAR Data Quality Levels (QLs) - Specifications for the varying "QLs" link
    under the "Resources" section of the VT LiDAR Initiative web page for details
    - "vcgi.vermont.gov/lidar" . The NED is the ultimatel repository for the best
    available public domain raster elevation data of the conterminous United States,
    Alaska, Hawaii, and territorial islands in a seamless format from diverse source
    data and processed to a common coordinate system and unit of vertical measure.",nt"license_title":
